import React ,{Component} from "react"

class App2 extends Component {
   render(){
    return(
        <>
        <ul>
            <li>home</li>
            <li>movies</li>
            <li>games</li>
            <li>kids</li>
        </ul>
        </>
    )
   }
}
export default App2
